    //         </Link>

    //         <Link to="/recievedRequests" className="bg-blue-500 text-white p-2 rounded hover:bg-blue-600 transition duration-200">
    //           reciever Requests
    //         </Link>
    //       </div>
    //     </div>
    //   </section>

    //   <section className="container mx-auto mt-16">
    //     <h2 className="text-4xl font-bold text-primary mb-8">Popular Categories</h2>
    //     <div className="flex justify-center space-x-8">
    //       <span className="bg-secondary text-white p-4 rounded-lg shadow-lg hover:bg-primary transition duration-300">Fiction</span>
    //       <span className="bg-secondary text-white p-4 rounded-lg shadow-lg hover:bg-primary transition duration-300">Non-Fiction</span>
    //       <span className="bg-secondary text-white p-4 rounded-lg shadow-lg hover:bg-primary transition duration-300">Academic</span>
    //       <span className="bg-secondary text-white p-4 rounded-lg shadow-lg hover:bg-primary transition duration-300">Biography</span>
    //     </div>
    //   </section>
    // </main>


    <main class="container mx-auto px-6 py-12">

    <section class="text-center bg-white shadow-lg rounded-lg p-8 mb-12">
      <h2 class="text-4xl font-extrabold text-blue-600 mb-4">Discover, Exchange, Enjoy!</h2>
      <p class="text-lg text-gray-600 mb-8">Welcome to the ultimate book exchange platform. Discover new books, connect with fellow readers, and share your favorites.</p>
      <a href="#" class="inline-block px-6 py-3 bg-blue-600 text-white font-semibold rounded-full shadow-md hover:bg-blue-700 transition duration-300">
        Browse Books
      </a>
    </section>


    <section class="mb-12">
      <h3 class="text-3xl font-bold text-gray-800 mb-6">Featured Books</h3>
      <div class="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">

        <div class="bg-white rounded-lg shadow-lg hover:shadow-xl transition duration-300 p-5">
          <img src="https://images.unsplash.com/photo-1524995997946-a1c2e315a42f" alt="Book Cover" class="rounded-t-lg h-56 w-full object-cover mb-4"/>
          <h4 class="text-xl font-semibold mb-2">The Great Gatsby</h4>
          <p class="text-gray-600">A classic novel by F. Scott Fitzgerald that explores themes of wealth, society, and the American Dream.</p>
          <button class="mt-4 px-4 py-2 bg-green-500 text-white font-semibold rounded-lg hover:bg-green-600 transition duration-300">
            Request Exchange
          </button>
        </div>

        <div class="bg-white rounded-lg shadow-lg hover:shadow-xl transition duration-300 p-5">
          <img src="https://images.unsplash.com/photo-1512820790803-83ca734da794" alt="Book Cover" class="rounded-t-lg h-56 w-full object-cover mb-4"/>
          <h4 class="text-xl font-semibold mb-2">To Kill a Mockingbird</h4>
          <p class="text-gray-600">A profound story of racial injustice in the American South, written by Harper Lee.</p>
          <button class="mt-4 px-4 py-2 bg-green-500 text-white font-semibold rounded-lg hover:bg-green-600 transition duration-300">
            Request Exchange
          </button>
        </div>

        <div class="bg-white rounded-lg shadow-lg hover:shadow-xl transition duration-300 p-5">
          <img src="https://images.unsplash.com/photo-1532012197276-a07f4a4885bf" alt="Book Cover" class="rounded-t-lg h-56 w-full object-cover mb-4"/>
          <h4 class="text-xl font-semibold mb-2">1984</h4>
          <p class="text-gray-600">A dystopian novel by George Orwell, offering a chilling depiction of totalitarianism.</p>
          <button class="mt-4 px-4 py-2 bg-green-500 text-white font-semibold rounded-lg hover:bg-green-600 transition duration-300">
            Request Exchange
          </button>
        </div>
      </div>
    </section>


    <section class="bg-blue-50 py-8 rounded-lg shadow-lg text-center">
      <h3 class="text-3xl font-bold text-gray-800 mb-6">What Our Users Say</h3>
      <div class="flex flex-col lg:flex-row items-center justify-around gap-8">

        <div class="max-w-md p-6 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
          <p class="text-gray-600 mb-4">"This platform has rekindled my love for reading. I've exchanged over 10 books and met amazing people in the process!"</p>
          <h4 class="font-semibold text-lg text-blue-600">- Alex Morgan</h4>
        </div>

        <div class="max-w-md p-6 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
          <p class="text-gray-600 mb-4">"An incredible way to find rare books and share knowledge. The exchange process is seamless and fun!"</p>
          <h4 class="font-semibold text-lg text-blue-600">- Rachel Adams</h4>
        </div>

        <div class="max-w-md p-6 bg-white rounded-lg shadow-md hover:shadow-lg transition duration-300">
          <p class="text-gray-600 mb-4">"I love the browsing experience and the variety of books available. A must-visit platform for all book lovers."</p>
          <h4 class="font-semibold text-lg text-blue-600">- John Doe</h4>
        </div>
      </div>
    </section>
  </main>

  );
};

export default MainContent;
